import React from "react";
import Header from "../components/Header";

export default function Homepage() {
  return (
    <>
      <Header />
      <main className="">
        <section className="min-h-screen bg-gray-400 pt-10">
          <h2 className="relative top-96 text-center text-5xl w-6/12">
            Welcome to Global Influence Church!
          </h2>
        </section>
      </main>
    </>
  );
}
